import React from "react";
import classes from './FeedPost.module.css'



const FeedPost = ({ post_num, res }) => {

    return (
        <div id={'feed_element_container' + post_num} className={classes.feed_element_container}>
            <div className={classes.feed_element_header}>
                <p>Новость №{post_num+1}</p>
            </div>
            <div id={"feed_element_content"+post_num} className="feed_element_content">
                {res.map((e, index) => (
                    <p key={index} >{e}</p>
                ))}
            </div>
        </div>
    )
}

export default FeedPost;
